import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';

import LandingPage from './pages/LandingPage.jsx';

import './styles/App.css';
import './styles/LandingPage.css';

function App() {
  return (
    <Router>
      <div className="app-container">
        <LandingPage />
      </div>
    </Router>
  );
}

export default App;
